using System;
using System.Windows.Forms;

public static class Snippet
{
	public static void func(System.IntPtr filterFormRef)
	{
		Control myForm = System.Windows.Forms.Control.FromHandle(filterFormRef);
	  	new Myclass((Form)myForm);
	}
	public class Myclass
    {
        Form form;
        public Myclass(Form form)
        {
            this.form = form;
            form.Leave += form_Leave;
        }
        void form_Leave(object sender, EventArgs e)
        {
            form.Close();
        }
    }
}
